import Navbar from '../../layouts/frontend/Navbar';
import Users from '../frontend/users/users';
import Sidebar from '../../layouts/admin/Sidebar'

function Dashboard() {
    return (
       <div>
            <Navbar />
            <Sidebar />
            <Users />
        <h1>I am Dashboard</h1>
       </div>
    );
}

export default Dashboard;
